import React from 'react';
import Logo from '../Logo/Logo';
import Navigation from '../Navigation/Navigation';
import './Header.scss';

const Header = () => {
  const navigation = {
    homepage: {
      name: 'home',
      url: '/',
    },
    menu: {
      name: 'menu',
      url: '/menu',
    },
    services: {
      name: 'services',
      url: '/services',
    },
    about: {
      name: 'about',
      url: '/about',
    },
    shop: {
      name: 'shop',
      url: '/shop',
    },
    contact: {
      name: 'contact',
      url: '/contact',
    },
  };
  return (
    <header className="header">
      <Logo />
      <Navigation />
    </header>
  );
};

export default Header;
